import React, { useEffect, useState } from "react";
import Svg from "./Svgs";

const Input = ({ team, setTeam }) => {
  return (
    <input
      type="text"
      placeholder="enter a team"
      style={{ display: "block" }}
      onChange={e => setTeam(e.target.value)}
    />
  );
};

export default Input;
